def dp(s, t, memo) -> int:
    print(f'dp call: {s}, {t}')
    if (s, t) in memo:
        return memo[(s, t)]
    if t == '':
        return 1
    
    if s == '':
        return 0
    
    i = 0
    possibilities = 0

    while i < len(s):
        if s[i] == t[0]:
            possibilities += dp(s[i+1:], t[1:], memo)

        i += 1

    memo[(s, t)] = possibilities
    return memo[(s, t)]

    


class Solution:
    def numDistinct(self, s: str, t: str) -> int:
        for char in t:
            if char not in s:
                return 0

        memo = {}
        return dp(s, t, memo)
    

newSol = Solution()
